import InputText from "../formComponents/TxtInput";
const defaultValues = {
    textValue: ' ',
    radioValue: ' ',
    checkboxValue: [],
    dateValue: new Date(),
    dropdownValue: ' ',
    sliderValue: 0
};

const RegisterForm =()=>{
    const methods = useForm({defaultValues:defaultValues});
    const { handleSubmit, reset, control, setValue, watch } = methods;
    const onSubmit = (data)=>{ console.log(data);};

    return (
        <FormProvider>
            <Paper
            style={{
                display: 'grid',
                gridRowGap: '20px',
                padding: '20px',
                margin: '10px 300px',

            }}
            >
            <InputText name='textValue' control={control} label='text Input'/>
            </Paper>
        </FormProvider>
       
    )
    
};
export default RegisterForm;
